import {
    createBrowserRouter,
    RouterProvider,
  } from "react-router-dom";
import App from "../App";
import { Header } from "../containers";

  const router = createBrowserRouter([
    {
      path: "/",
      element: <App/>,
      children:[
        {
            path:'/',
            element:<Header/>
        },
    ]
    },
    {
        path:'/evaluate',
        element:<Evaluate/>
    },

  ]);

  export default router
